import React from "react";
function Add() {
  return (
    <ol>
      <li>Addition of two number</li>
      <li>Substraction of two number</li>
      <li>Multiplication Of Two number</li>
      <li>Division Of Two Number</li>
    </ol>
  );
}
export default App;
